import React, { useState, useEffect } from "react";

import { BrowserRouter, Route, Switch } from "react-router-dom";

import { MovieList } from "./components/MovieList";

export const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/">
          <MovieList />;
        </Route>
      </Switch>
    </BrowserRouter>
  );
  return;
};
